	add("moment", "{\"term\":\"moment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027moment\u0027 from Latin \u0027momentum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brief, unspecified amount of time\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dThen came a maid with hand-bag and shawls, and after her a tall young lady. She stood for a \u0027\u0027moment\u0027\u0027 holding her skirt above the grimy steps,, and the light of the reflector fell full upon her\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1521052W A Cuckoo in the passage\u003dSophia broke down here. Even at this \u0027\u0027moment\u0027\u0027 she was subconsciously comparing her rendering of the part of the forlorn bride with Miss Marie Lohr\u0027s\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/books/2013/may/23/holy-shit-history-swearing-mohr Where the profound meets the passage\u003dSwearing doesn\u0027t just mean what we now understand by \u0026quot;dirty words\u0026quot;. It is entwined, in social and linguistic history, with the other sort of swearing: vows and oaths. Consider for a \u0027\u0027moment\u0027\u0027 the origins of almost any word we have for bad language – \u0026quot;profanity\u0026quot;, \u0026quot;curses\u0026quot;, \u0026quot;oaths\u0026quot; and \u0026quot;swearing\u0026quot; itself\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The smallest portion of time; an instant\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHere, in the transept and choir, where the service was being held, one was conscious every \u0027\u0027moment\u0027\u0027 of an increasing brightness; colours glowing vividly beneath the circular chandeliers, and the rows of small lights on the choristers\u0027 desks flashed and sparkled in front of the boys\u0027 faces, deep linen collars, and red neckbands\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Weight or importance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1597\u0027\u0027, \u0027\u0027, 3,7,67\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In deep designs, in matter of great \u0027\u0027moment\u0027\u0027, / No less importing than our general good\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, \u0027\u0027, (Norton 2005, p.1192\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The document in question is of such immense importance that its publication might very easily – I might almost say probably – lead to European complications of the utmost \u0027\u0027moment\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The turning effect of a force applied to a rotational system at a distance from the axis of rotation. Also called moment of force\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A definite period of time, specifically one-tenth of a point, or one-fortieth or one-fiftieth of an hour\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A petit mal episode; such a spell\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A fit, a short-duration tantrum, a hissy\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"An infinitesimal change in a varying quantity; an increment or decrement\", \"priority\":16}]}, \"synonyms\":{}}");

